import ExpenseItem from "./Components/ExpenseItem";
function App() {
  let arr = [
    { date: new Date(2022, 11, 24), title: "Car Insurance", price: 2000 },
    { date: new Date(2021, 2, 2), title: "Netfilx Subscription", price: 599 },
  ];
  return (
    <div>
      <h2>Let's get started!</h2>

      {arr.map(e => (
        <ExpenseItem
        title={e.title}
        date={e.date}
        price={e.price}
      ></ExpenseItem>
      ))}
      <ExpenseItem
        title={arr[0].title}
        date={arr[0].date}
        price={arr[0].price}
      ></ExpenseItem>
      <ExpenseItem
        title={arr[1].title}
        date={arr[1].date}
        price={arr[1].price}
      ></ExpenseItem>
    </div>
  );
}

export default App;
